import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [params, setParams] = useState({ price: 0 });

  const handleChange = (evt) => {
    const value = evt.target.value;
    setParams({
      ...params, [evt.target.name]: value
    });
  }


  return (
    <div className="App">
      <div>

        <input type="text" name="price" value={params.price} onChange={handleChange} />
      </div>
    </div>
  );
}

export default App;
